import React, { useState } from "react";
import Cleave from "cleave.js/react";
import { useMutation, gql } from "@apollo/client";

import registerForm from "./registerForm.css";
import JSON_UF from "../../uf.json";

const NEW_STUDENT = gql`
  mutation newStudent(
    $name: String!
    $documentType: String!
    $documentOrgan: String!
    $documentUF: String!
    $documentNumber: String!
    $cpf: String!
    $birthDate: Date!
    $cep: String
    $uf: String!
    $city: String!
    $street: String!
    $streetNumber: Int!
    $district: String!
    $complement: String
    $telephoneNumber: String
    $cellphoneNumber: String
    $email: String
    $civilState: String
    $sex: String
    $placeOfBirth: String
    $nacionality: String
    $fatherName: String
    $motherName: String
    $renach: String
    $bloodType: String
    $scholarity: String
    $profession: String
    $company: String
  ) {
    newStudent(
      name: $name
      documentType: $documentType
      documentOrgan: $documentOrgan
      documentUF: $documentUF
      documentNumber: $documentNumber
      cpf: $cpf
      birthDate: $birthDate
      cep: $cep
      uf: $uf
      city: $city
      street: $street
      streetNumber: $streetNumber
      district: $district
      complement: $complement
      telephoneNumber: $telephoneNumber
      cellphoneNumber: $cellphoneNumber
      email: $email
      civilState: $civilState
      sex: $sex
      placeOfBirth: $placeOfBirth
      nacionality: $nacionality
      fatherName: $fatherName
      motherName: $motherName
      renach: $renach
      bloodType: $bloodType
      scholarity: $scholarity
      profession: $profession
      company: $company
    ) {
      id
    }
  }
`;

function validInputs(errors) {
  console.log(Object.values(errors))
  return !Object.values(errors).some((value) => value === true);
}

function validateCPF(cpf) {
  const sum1 =
    cpf[0] * 10 +
    cpf[1] * 9 +
    cpf[2] * 8 +
    cpf[4] * 7 +
    cpf[5] * 6 +
    cpf[6] * 5 +
    cpf[8] * 4 +
    cpf[9] * 3 +
    cpf[10] * 2;
  const sum2 =
    cpf[0] * 11 +
    cpf[1] * 10 +
    cpf[2] * 9 +
    cpf[4] * 8 +
    cpf[5] * 7 +
    cpf[6] * 6 +
    cpf[8] * 5 +
    cpf[9] * 4 +
    cpf[10] * 3 +
    cpf[12] * 2;
  const rest1 = sum1 % 11;
  const rest2 = sum2 % 11;
  let j;
  let k;

  if (rest1 == 0 || rest1 == 1) j = 0;
  else j = 11 - rest1;

  if (rest2 == 0 || rest2 == 1) k = 0;
  else k = 11 - rest2;

  return cpf[12] == j && cpf[13] == k;
}

function validate({
  name,
  documentNumber,
  documentType,
  documentOrgan,
  documentUF,
  cpf,
  birthDate,
  uf,
  city,
  street,
  streetNumber,
  district,
}) {
  return {
    name: name.length === 0,
    documentNumber: documentNumber.length === 0,
    documentType: documentType.length === 0,
    documentOrgan: documentOrgan.length === 0,
    documentUF: documentUF.length === 0,
    cpf: !validateCPF(cpf),
    birthDate: birthDate.length === 0,
    uf: uf.length === 0,
    city: city.length === 0,
    street: street.length === 0,
    streetNumber: streetNumber.length === 0,
    district: district.length === 0,
  };
}

